import gql from 'graphql-tag';

const GET_QUESTION_QUERY = gql`
  query getQuestionList {
    getQuestionList {
      id
      title
      status
      user {
        id
        name
        email
      }
    }
  }
`;

const GET_MY_PROFILE_QUERY = gql`
query getMyProfile{
  myProfile {
    email
    name
  }
}`

const GET_RECOMMEND_QUESTION_QUERY = gql`
query recommendQuestionList{
  recommendQuestions {
    id
    title
    createdAt
    
  }
}`

const GET_SEARCH_QUERY = gql`
query getQuestionByTitle($title: String!){
  getQuestionByTitle(title: $title) {
    id
    title
    createdAt
  }
}`


const GET_MY_QUESTIONS_QUERY = gql`
query myQuestion{
  myQuestions {
    id
    title   
  }
}`;

export {GET_RECOMMEND_QUESTION_QUERY, GET_QUESTION_QUERY, GET_SEARCH_QUERY, GET_MY_PROFILE_QUERY, GET_MY_QUESTIONS_QUERY}
